import React, {useState, useEffect} from 'react';
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import './App.css';
import Gallery from "./components/Gallery";
import Heading from "./components/Heading";
import Footer from "./components/Footer";
import About from "./components/About";
import UnderLineSection from "./components/UnderLineSection";
import Main from "./components/Main";
import Hero from "./components/Hero"
import UnderLineSectionReverse from "./components/UnderLineSectionReverse";

function App() {
    const [time, setTime] = useState(0)
    useEffect(() => {
        fetch('/time').then(res => res.json()).then(data => {
            setTime(data.time);
        });
    }, []);




        return (
            <div>
            <Router>
                <Switch>
                    <Route path="/" exact component={()=><Gallery/>}/>
                    <Route path="Prime Day Concerts" exact component={()=><Detail project={"pdc"}/>}/>
                    <Route path="Prime Day Concerts" exact component={()=><Detail project={"oft"}/>}/>
                    <Route path="Prime Day Concerts" exact component={()=><Detail project={"flair"}/>}/>
                    <Route path="Prime Day Concerts" exact component={()=><Detail project={"pets"}/>}/>
                </Switch>
            </Router>


                <Gallery />
                <About/>
                <Footer/>
            </div>
        )
}

export default App;
